        "rek_pid": "UQ:384242",
        "rek_title": "The voltage gated Ca2+-channel Cav3.2 and therapeutic responses in breast cancer",
        "rek_description": "Understanding the cause of therapeutic resistance and identifying new biomarkers in breast cancer to predict therapeutic responses will help optimise patient care. Calcium (Ca(2+))-signalling is important in a variety of processes associated with tumour progression, including breast cancer cell migration and proliferation. Ca(2+)-signalling is also linked to the acquisition of multidrug resistance. This study aimed to assess the expression level of proteins involved in Ca(2+)-signalling in an in vitro model of trastuzumab-resistance and to assess the ability of identified targets to reverse resistance and\/or act as potential biomarkers for prognosis or therapy outcome.",
