        "rek_title": "Comprehensive annotation of splice junctions supports pervasive alternative splicing at the BRCA1 locus: a report from the ENIGMA consortium",
        "rek_description": "Loss-of-function germline mutations in BRCA1 (MIM #113705) confer markedly increased risk of breast and ovarian cancer. The full-length transcript codifies for a protein involved in DNA repair pathways and cell-cycle checkpoints. Several BRCA1 splicing isoforms have been described in public domain databases, but the physiological role (if any) of BRCA1 alternative splicing remains to be established. An accurate description of \u2018naturally occurring\u2019 alternative splicing at this locus is a prerequisite to understand its biological significance. However, a systematic analysis of alternative splicing at the BRCA1 locus is yet to be conducted. Here, the Evidence-Based Network for the Interpretation of Germ-Line Mutant Alleles consortium combines RT-PCR, exon scanning, cloning, sequencing and relative semi-quantification to describe naturally occurring BRCA1 alternative splicing with unprecedented resolution. The study has been conducted in blood-related RNA sources, commonly used for clinical splicing assays, as well as in one healthy breast tissue. We have characterized a total of 63 BRCA1 alternative splicing events, including 35 novel findings. A minimum of 10 splicing events (\u03941Aq, \u03945, \u03945q, \u03948p, \u03949, \u0394(9,10), \u03949_11, \u039411q, \u039413p and \u039414p) represent a substantial fraction of the full-length expression level (ranging from 5 to 100%). Remarkably, our data indicate that BRCA1 alternative splicing is similar in blood and breast, a finding supporting the clinical relevance of blood-based in vitro splicing assays. Overall, our data suggest an alternative splicing model in which most non-mutually exclusive alternative splicing events are randomly combined into individual mRNA molecules to produce hundreds of different BRCA1 isoforms.",
