        "rek_title": "eLCR: electrochemical detection of single DNA base changes via ligase chain reaction",
        "rek_description": "Simple, inexpensive and wide-scaled analysis of single DNA base changes (\u2018point mutations\u2019 which include SNP\u2019s, somatic mutations and epigenetic changes) is one of the holy grail\u2019s of point-of-care diagnostics. Herein, we present eLCR: a simple methodology that fuses Ligase Chain Reaction (LCR) with electrochemical detection based on DNA-mediated charge transport. LCR generates long and short \u201cknife\u201d motifs representing the presence or absence of single DNA base changes, which are then detected electrochemically by either methylene blue intercalation or horseradish peroxidase labelling.",
