        "rek_pid": "UQ:283931",
        "rek_title": "Long-range transcriptional regulation of breast cancer genes",
        "rek_description": "Breast cancer is a major health problem and understanding the genetic basis of this disease is crucial for predicting risk and developing effective targeted therapeutics. Several breast cancer predisposing genes have been identified, but mutations in the coding regions of these genes only accounts for a small proportion of risk. Research now suggests that combinations of multiple non-coding changes in breast cancer susceptibility genes, which cause moderate alterations in gene expression, will be responsible for the remaining inherited risk. These non-coding changes will include variants in proximal and distal transcriptional and post-transcriptional regulatory elements and may affect the levels and function of trans-acting factors, including proteins and RNAs, which act on these elements. Somatic changes in such elements and factors have also been associated with breast cancer progression. With the recent advent of techniques allowing the detection of long-range DNA interactions spanning the human genome, it has become increasingly clear that long-range regulatory elements constitute an important mechanism for gene regulation. Recent studies have identified several such elements that are important for regulating genes involved in breast cancer, raising the possibility that defects in these sequences may contribute to breast cancer predisposition and progression. In this review, we discuss the emerging functions of cis-regulatory elements and a subset of trans-acting factors in breast tumorigenesis. We also discuss some recent progress in our understanding of how dysregulation in these transcriptional components may contribute to breast cancer, and the potential implications for molecular diagnosis, prognosis prediction, and the treatment of this disease.",
